import React, { Component } from 'react'
import { Link } from 'react-router-dom'

import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';
import { withRouter } from "react-router";


class HeaderBar extends Component {
	constructor(props) {
		super(props);
		this.toggle = this.toggle.bind(this);
		this.state = {
	  		isOpen: false
		};
	}
	toggle() {
		this.setState({
	  	isOpen: !this.state.isOpen
		});
	}
	render(){ 
		let currentPathname = this.props.location.pathname;

console.log( currentPathname )

		return (
	        <Navbar dark expand="sm" className={'navbar'}>
	          <NavbarBrand href="/">Good Greens</NavbarBrand>
	          <NavbarToggler onClick={this.toggle} />
	          <Collapse isOpen={this.state.isOpen} navbar>
	            <Nav className="ml-auto" navbar>
	              <NavItem>
	                <NavLink tag={Link} to="/" active={currentPathname==='/'||currentPathname===''?true:false}>Search</NavLink>
	              </NavItem>
	              <NavItem>
	                <NavLink tag={Link} to="/naughty/" active={currentPathname==='/naughty/'?true:false}>Naughty List</NavLink>
	              </NavItem>
	              <NavItem>
	                <NavLink tag={Link} to="/about/" active={currentPathname==='/about/'?true:false}>About</NavLink>
	              </NavItem>
              </Nav>
	          </Collapse>
	        </Navbar>
		)
	}
}
const HeaderBarWithRouter = withRouter(HeaderBar);


export default HeaderBarWithRouter;


